import { connect } from "react-redux";

const Favorites = () => {
    return (
    <div>
        <h1>My Favorites</h1>
    </div>
    )
};

const mapStateToProps = (state) => {
    return {
        myFavorites: state.myFavorites
    }
}

export default connect(mapStateToProps, null) (Favorites);
